const InfoList = (props) => {
  const info = props.info;
  // console.log(info);
  return (
    <>
      <div>InfoList</div>
      <ul>
        {" "}
        {info.map((info) => {
          return (
            <>
              <div>
                {info.id}: {info.value}
              </div>
              <button>Edit</button>
            </>
          );
        })}
      </ul>
    </>
  );
};

export default InfoList;
